import Head from "./Head";
import Text from "./Text";
import Team from "./Team";
import Counter from "./Counter";

class App extends Component {
  render() {
    return (
      <div>
        <Head />
        <div className="container">
          <Text />
          <Team />
          {/* <Counter /> */}
        </div>
      </div>
    );
  }
}

export default App;
